CREATE TRIGGER reduce_stock
AFTER INSERT ON sales
FOR EACH ROW
BEGIN
UPDATE stock SET stock = stock - NEW.quantity WHERE product_id = NEW.product_id;
END;

CREATE TRIGGER tambah_stok
AFTER INSERT ON sepatu
FOR EACH ROW
BEGIN
UPDATE stok SET jumlah_stok = jumlah_stok + NEW.jumlah_sepatu;
END;

