def comment_approve(request, comment_id):
    comment = Comment.objects.get(pk=comment_id)
    comment.approve()
    return redirect('home')

@login_required
def comment_remove(request, comment_id):
    comment = Comment.objects.get(pk=comment_id)
    comment.delete()
    return redirect('home')

